import React, { useState, useEffect } from 'react';
import './Navbar.css';
import logo from './Pictures/Logo.png';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPhone, faMobileAlt, faChevronDown, faWrench, faHammer, faWater, faHome, faTools } from '@fortawesome/free-solid-svg-icons';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [scrolled, setScrolled] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      setScrolled(window.scrollY > 60);
    };

    const handleResize = () => {
      if (window.innerWidth > 768) {
        setIsOpen(false);
      }
    };

    window.addEventListener('scroll', handleScroll);
    window.addEventListener('resize', handleResize);

    return () => {
      window.removeEventListener('scroll', handleScroll);
      window.removeEventListener('resize', handleResize);
    };
  }, []);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  return (
    <header className="navbar">
      <div className="navbar__top">
        <div className="navbar__contact">
          <span>
            <FontAwesomeIcon icon={faPhone} /> Office: (718)-200-0699
          </span>
          <span>
            <FontAwesomeIcon icon={faMobileAlt} /> Cell: (718)-300-7014
          </span>
          <span>30+ Years Experience | Fully Licensed | Fully Insured | MBE Certified Contractor</span>
        </div>
        <button className="navbar__estimate">Free Estimate</button>
      </div>
      <div className={`navbar__main ${scrolled ? 'scrolled' : ''}`}>
        <div className="navbar__brand">
          <img src={logo} alt="Company Logo" className="navbar__logo navbar__logo--desktop" />
        </div>
        <nav className={`navbar__menu ${isOpen ? 'navbar__menu--open' : ''}`}>
          <a href="#home" className="navbar__link">Home</a>
          <a href="#about" className="navbar__link">About Us</a>
          <div className="navbar__dropdown">
            <a href="#services" className="navbar__link">
              Services <FontAwesomeIcon icon={faChevronDown} className="navbar__dropdown-icon" />
            </a>
            <div className="navbar__dropdown-menu">
              <div className="navbar__dropdown-item">
                <FontAwesomeIcon icon={faWrench} /> Masonry Services
                <div className="navbar__sub-dropdown-menu">
                  <a href="#brick-pointing" className="navbar__sub-dropdown-link"><FontAwesomeIcon icon={faHammer} /> Brick Pointing</a>
                  <a href="#brick-repair" className="navbar__sub-dropdown-link"><FontAwesomeIcon icon={faHammer} /> Brick Repair & Replacement</a>
                  <a href="#brick-work" className="navbar__sub-dropdown-link"><FontAwesomeIcon icon={faHammer} /> Brick Work</a>
                  <a href="#chimney" className="navbar__sub-dropdown-link"><FontAwesomeIcon icon={faHome} /> Chimney</a>
                  <a href="#driveway-repair" className="navbar__sub-dropdown-link"><FontAwesomeIcon icon={faTools} /> Driveway Repair</a>
                  <a href="#pavers" className="navbar__sub-dropdown-link"><FontAwesomeIcon icon={faTools} /> Pavers</a>
                  <a href="#retaining-walls" className="navbar__sub-dropdown-link"><FontAwesomeIcon icon={faTools} /> Retaining Walls</a>
                  <a href="#sidewalk-repair" className="navbar__sub-dropdown-link"><FontAwesomeIcon icon={faTools} /> Sidewalk Repair</a>
                  <a href="#sidewalk-violation" className="navbar__sub-dropdown-link"><FontAwesomeIcon icon={faTools} /> Sidewalk Violation Removal</a>
                  <a href="#stoops-porches" className="navbar__sub-dropdown-link"><FontAwesomeIcon icon={faTools} /> Stoops & Porches</a>
                  <a href="#stucco" className="navbar__sub-dropdown-link"><FontAwesomeIcon icon={faTools} /> Stucco</a>
                  <a href="#thorocoat-thoroseal" className="navbar__sub-dropdown-link"><FontAwesomeIcon icon={faTools} /> Thorocoat & Thoroseal</a>
                  <a href="#veneers-pillars" className="navbar__sub-dropdown-link"><FontAwesomeIcon icon={faTools} /> Veneers Pillars</a>
                </div>
              </div>
              <a href="#roofing" className="navbar__dropdown-link"><FontAwesomeIcon icon={faHome} /> Roofing</a>
              <a href="#siding" className="navbar__dropdown-link"><FontAwesomeIcon icon={faHome} /> Siding</a>
              <a href="#gutter" className="navbar__dropdown-link"><FontAwesomeIcon icon={faWater} /> Gutter</a>
              <a href="#waterproofing" className="navbar__dropdown-link"><FontAwesomeIcon icon={faWater} /> Waterproofing Services</a>
              <a href="#variety-services" className="navbar__dropdown-link"><FontAwesomeIcon icon={faTools} /> Variety of Services</a>
              <a href="#local-law" className="navbar__dropdown-link"><FontAwesomeIcon icon={faTools} /> Local LAW 11 & 10</a>
            </div>
          </div>
          <a href="#portfolio" className="navbar__link">Our Portfolio</a>
          <a href="#blog" className="navbar__link">Blog</a>
          <a href="#contact" className="navbar__link">Contact Us</a>
        </nav>
        <button className={`navbar__toggle ${isOpen ? 'navbar__toggle--open' : ''}`} onClick={toggleMenu}>
          <div className={`navbar__toggle-icon ${isOpen ? 'navbar__toggle-icon--open' : ''}`}></div>
        </button>
      </div>
      {isOpen && (
        <div className="navbar__mobile-menu">
          <button className="navbar__close" onClick={toggleMenu}>×</button>
          <a href="#home" className="navbar__mobile-link" onClick={toggleMenu}>Home</a>
          <a href="#about" className="navbar__mobile-link" onClick={toggleMenu}>About Us</a>
          <a href="#services" className="navbar__mobile-link" onClick={toggleMenu}>Services</a>
          <div className="navbar__dropdown navbar__dropdown--mobile">
            <a href="#services" className="navbar__mobile-link">
              Services <FontAwesomeIcon icon={faChevronDown} className="navbar__dropdown-icon" />
            </a>
            <div className="navbar__dropdown-menu">
              <a href="#masonry" className="navbar__mobile-link"><FontAwesomeIcon icon={faWrench} /> Masonry Services</a>
              <a href="#roofing" className="navbar__mobile-link"><FontAwesomeIcon icon={faHome} /> Roofing</a>
              <a href="#siding" className="navbar__mobile-link"><FontAwesomeIcon icon={faHome} /> Siding</a>
              <a href="#gutter" className="navbar__mobile-link"><FontAwesomeIcon icon={faWater} /> Gutter</a>
              <a href="#waterproofing" className="navbar__mobile-link"><FontAwesomeIcon icon={faWater} /> Waterproofing Services</a>
              <a href="#variety-services" className="navbar__mobile-link"><FontAwesomeIcon icon={faTools} /> Variety of Services</a>
              <a href="#local-law" className="navbar__mobile-link"><FontAwesomeIcon icon={faTools} /> Local LAW 11 & 10</a>
            </div>
          </div>
          <a href="#portfolio" className="navbar__mobile-link" onClick={toggleMenu}>Our Portfolio</a>
          <a href="#blog" className="navbar__mobile-link" onClick={toggleMenu}>Blog</a>
          <a href="#contact" className="navbar__mobile-link" onClick={toggleMenu}>Contact Us</a>
          <div className="navbar__contact-mobile">
            <span>
              <FontAwesomeIcon icon={faPhone} /> Office: (718)-200-0699
            </span>
            <span>
              <FontAwesomeIcon icon={faMobileAlt} /> Cell: (718)-300-7014
            </span>
            <span>30+ Years Experience | Fully Licensed | Fully Insured | MBE Certified Contractor</span>
          </div>
          <button className="navbar__estimate-mobile">Free Estimate</button>
        </div>
      )}
    </header>
  );
};

export default Navbar;
